        return (
            <div className="App">
                <Controller/>
                <div className='m-5'>
                    <div className="bg-secondary w-25 d-block mx-auto py-5">
                        <Light color={payload}/>
                    </div>
                    <div className='d-flex justify-content-around bg-secondary p-5'>
                        <div className='rotate-left'>
                            <Light color={'red'}/>
                        </div>
                        <div className='rotate-right'>
                            <Light color={'red'}/>
                        </div>
                    </div>
                    <div className="bg-secondary w-25 d-block mx-auto py-5">
                        <Light color={'red'}/>
                    </div>
                </div>
            </div>
        );
    }
}

export default App;
